survey_comment:
MEAE is mostly financing on its budget :
- AFD projects (in grants);
- European development Fund and international organisations;
- humanitarian aid and food aid programmes;
- small projects, (FSP and FSPI) supervised directly by our network.
There are calls for proposals to support decentralized cooperation :

https://www.diplomatie.gouv.fr/fr/politique-etrangere-de-la-france/action-exterieure-des-collectivites-territoriales/appels-a-projets-et-fonds-en-soutien-a-la-cooperation-decentralisee/appel-a-projets-annuels/article/appel-a-projets-generaliste-2018
